import React,{PureComponent,ReactFragment} from 'react';
import {Form,TextField,Checkbox,Link,Button} from '@adobe/react-spectrum';

class LoginForm extends PureComponent{

    render(){
        return(

          <Form  isQuiet >
              <h3>ACCOUNT LOGIN</h3>
            <TextField label="Email" type="email" placeholder="abc@adobe.com" width="70%" marginStart="single-line-height"/>
            <TextField label="Password" type="password"placeholder="1234"  width="70%" marginStart="single-line-height" />

            <Checkbox marginStart="single-line-height">Remember me</Checkbox>
            <Link>
            <a href="#" > Forgot Password?</a>
            </Link>

            <Button variant="cta" type="submit" 
            width="70%" 
            marginStart="single-line-height"
            > 
                Login
            </Button>

            <Link justifySelf="center">
            <a href="#" > Sign up</a>
            </Link>
         </Form>

        );
    }
}
export default LoginForm;
